import React from 'react';
import Landing from'./Landing'
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">

        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
        <Link to="/landing">Landing</Link>
      </header>
    </div>
  );
}

export default App;
